@app.cell
def _(LabeledSampleable, Tuple, nn, torch):
    class GMM(nn.Module, LabeledSampleable):
        def __init__(
            self,
            means: torch.Tensor,
            covariances: torch.Tensor,
            weights: torch.Tensor,
        ):
            super().__init__()
            self.means = nn.Buffer(means)
            self.covariances = nn.Buffer(covariances)
            self.weights = nn.Buffer(weights)

        def sample(self, num_samples: int) -> Tuple[torch.Tensor, torch.Tensor]:
            """
            Args:
              - num_samples: the desired number of samples
            Returns:
              - samples: b n
              - labels: b
            """
            # Choose the amount of each mode
            # Perform multinomial sampling on CPU to avoid device-side assert errors
            labels = torch.multinomial(
                self.weights.cpu(), num_samples=num_samples, replacement=True
            ).to(self.means.device)

            # Sample from each mode
            samples = torch.zeros(num_samples, self.means.shape[1]).to(
                self.means.device
            )
            for idx in range(len(self.means)):
                samples[labels == idx] = (
                    torch.randn_like(samples[labels == idx])
                    * self.covariances[idx]
                    + self.means[idx]
                )

            return samples, labels

    return (GMM,)


