@app.cell
def _(ABC, LabeledSampleable, Sampleable, Tuple, abstractmethod, nn, torch):
    class ConditionalProbabilityPath(nn.Module, ABC):
        """
        Abstract base class for conditional probability paths
        """

        def __init__(self, p_simple: Sampleable, p_data: LabeledSampleable):
            super().__init__()
            self.p_simple = p_simple
            self.p_data = p_data

        def sample_marginal_path(self, t: torch.Tensor) -> torch.Tensor:
            """
            Samples from the marginal distribution p_t(x) = p_t(x|z) p(z)
            Args:
                - t: b
            Returns:
                - x: samples from p_t(x), b ... (i.e.,. `b d`, `b c h w`, etc.)
            """
            num_samples = t.shape[0]
            # Sample conditioning variable z ~ p(z)
            z, _ = self.sample_conditioning_variable(num_samples)  # (b ...)
            # Sample conditional probability path x ~ p_t(x|z)
            x = self.sample_conditional_path(z, t)  # (b ...)
            return x

        @abstractmethod
        def sample_conditioning_variable(
            self, num_samples: int
        ) -> Tuple[torch.Tensor, torch.Tensor]:
            """
            Samples the conditioning variable z and label y
            Args:
                - num_samples: the number of samples
            Returns:
                - z: b ...
                - y: b
            """
            pass

        @abstractmethod
        def sample_conditional_path(
            self, z: torch.Tensor, t: torch.Tensor
        ) -> torch.Tensor:
            """
            Samples from the conditional distribution p_t(x|z)
            Args:
                - z: conditioning variable b ...
                - t: time b
            Returns:
                - x: samples from p_t(x|z), b ...
            """
            pass

        @abstractmethod
        def conditional_vector_field(
            self, x: torch.Tensor, z: torch.Tensor, t: torch.Tensor
        ) -> torch.Tensor:
            """
            Evaluates the conditional vector field u_t(x|z)
            Args:
                - x: b ...
                - z: b ...
                - t: b
            Returns:
                - conditional_vector_field: conditional vector field b c h w
            """
            pass

        @abstractmethod
        def conditional_score(
            self, x: torch.Tensor, z: torch.Tensor, t: torch.Tensor
        ) -> torch.Tensor:
            """
            Evaluates the conditional score of p_t(x|z)
            Args:
                - x: b ...
                - z: b ...
                - t: b
            Returns:
                - score: b ...
            """
            pass

    return (ConditionalProbabilityPath,)


