@app.cell
def _(
    ABC,
    ConditionalProbabilityPath,
    IsotropicGaussian,
    List,
    Rearrange,
    Sampleable,
    abstractmethod,
    jacrev,
    torch,
    vmap,
):
    class Alpha(ABC):
        def __init__(self):
            # Check alpha_t(0) = 0
            assert torch.allclose(
                self(
                    torch.zeros(
                        1,
                    )
                ),
                torch.zeros(
                    1,
                ),
            )
            # Check alpha_1 = 1
            assert torch.allclose(
                self(
                    torch.ones(
                        1,
                    )
                ),
                torch.ones(
                    1,
                ),
            )

        @abstractmethod
        def __call__(self, t: torch.Tensor) -> torch.Tensor:
            """
            Evaluates alpha_t. Should satisfy: self(0.0) = 0.0, self(1.0) = 1.0.
            Args:
                - t: b
            Returns:
                - alpha_t: b
            """
            pass

        def dt(self, t: torch.Tensor) -> torch.Tensor:
            """
            Evaluates d/dt alpha_t.
            Args:
                - t: b
            Returns:
                - d/dt a_t: b
            """
            t = t.unsqueeze(1)
            dt = vmap(jacrev(self))(t)
            return dt.view(-1)


    class Beta(ABC):
        def __init__(self):
            # Check beta_0 = 1
            assert torch.allclose(self(torch.zeros(1)), torch.ones(1))
            # Check beta_1 = 0
            assert torch.allclose(self(torch.ones(1)), torch.zeros(1))

        @abstractmethod
        def __call__(self, t: torch.Tensor) -> torch.Tensor:
            """
            Evaluates alpha_t. Should satisfy: self(0.0) = 1.0, self(1.0) = 0.0.
            Args:
                - t: b
            Returns:
                - beta_t: b
            """
            pass

        def dt(self, t: torch.Tensor) -> torch.Tensor:
            """
            Evaluates d/dt beta_t.
            Args:
                - t: b
            Returns:
                - d/dt beta_t: b
            """
            t = t.unsqueeze(1)
            dt = vmap(jacrev(self))(t)
            return dt.view(-1)


    class LinearAlpha(Alpha):
        """
        Implements alpha_t = t
        """

        def __call__(self, t: torch.Tensor) -> torch.Tensor:
            """
            Args:
                - t: b
            Returns:
                - alpha_t: b
            """
            return t

        def dt(self, t: torch.Tensor) -> torch.Tensor:
            """
            Evaluates d/dt alpha_t.
            Args:
                - t: b
            Returns:
                - d/dt alpha_t b
            """
            return torch.ones_like(t)


    class LinearBeta(Beta):
        """
        Implements beta_t = 1-t
        """

        def __call__(self, t: torch.Tensor) -> torch.Tensor:
            """
            Args:
                - t: b
            Returns:
                - beta_t: b
            """
            return 1 - t

        def dt(self, t: torch.Tensor) -> torch.Tensor:
            """
            Evaluates d/dt alpha_t.
            Args:
                - t: b
            Returns:
                - d/dt alpha_t: b
            """
            return -torch.ones_like(t)


    class GaussianConditionalProbabilityPath(ConditionalProbabilityPath):
        def __init__(
            self,
            p_data: Sampleable,
            p_simple_shape: List[int],
            alpha: Alpha,
            beta: Beta,
        ):
            p_simple = IsotropicGaussian(shape=p_simple_shape, std=1.0)
            super().__init__(p_simple, p_data)
            self.alpha = alpha
            self.beta = beta
            self.rearrange_scalar = Rearrange(
                f"b -> b{' 1' * len(p_simple_shape)}"
            )

        def sample_conditioning_variable(self, num_samples: int) -> torch.Tensor:
            """
            Samples the conditioning variable z and label y
            Args:
                - num_samples: the number of samples
            Returns:
                - z: b ...
                - y: b
            """
            return self.p_data.sample(num_samples)

        def sample_conditional_path(
            self, z: torch.Tensor, t: torch.Tensor
        ) -> torch.Tensor:
            """
            Samples from the conditional distribution p_t(x|z)
            Args:
                - z: b ...
                - t: b
            Returns:
                - x: b ...
            """
            alpha_t = self.rearrange_scalar(self.alpha(t))  # (b 1 1 1)
            beta_t = self.rearrange_scalar(self.beta(t))  # (b 1 1 1)
            return alpha_t * z + beta_t * torch.randn_like(z)

        def conditional_vector_field(
            self, x: torch.Tensor, z: torch.Tensor, t: torch.Tensor
        ) -> torch.Tensor:
            """
            Evaluates the conditional vector field u_t(x|z)
            Args:
                - x: b c h w
                - z: b c h w
                - t: b
            Returns:
                - conditional_vector_field: conditional vector field (num_samples, c, h, w)
            """
            alpha_t = self.rearrange_scalar(self.alpha(t))  # b
            beta_t = self.rearrange_scalar(self.beta(t))  # b
            dt_alpha_t = self.rearrange_scalar(self.alpha.dt(t))  # b
            dt_beta_t = self.rearrange_scalar(self.beta.dt(t))  # b

            return (
                dt_alpha_t - dt_beta_t / beta_t * alpha_t
            ) * z + dt_beta_t / beta_t * x

        def conditional_score(
            self, x: torch.Tensor, z: torch.Tensor, t: torch.Tensor
        ) -> torch.Tensor:
            """
            Evaluates the conditional score of p_t(x|z)
            Args:
                - x: b ...
                - z: b ...
                - t: b
            Returns:
                - conditional_score: b ...
            """
            alpha_t = self.rearrange_scalar(self.alpha(t))
            beta_t = self.rearrange_scalar(self.beta(t))
            return (z * alpha_t - x) / beta_t**2

    return GaussianConditionalProbabilityPath, LinearAlpha, LinearBeta


