def _(ABC, abstractmethod, torch):
    class ODE(ABC):
        @abstractmethod
        def drift_coefficient(
            self, xt: torch.Tensor, t: torch.Tensor, **kwargs
        ) -> torch.Tensor:
            """
            Returns the drift coefficient of the ODE.
            Args:
                - xt: b ...
                - t: b
            Returns:
                - drift_coefficient: b ...
            """
            pass


    class SDE(ABC):
        @abstractmethod
        def drift_coefficient(
            self, xt: torch.Tensor, t: torch.Tensor, **kwargs
        ) -> torch.Tensor:
            """
            Returns the drift coefficient of the ODE.
            Args:
                - xt: b ...
                - t: b
            Returns:
                - drift_coefficient: b ...
            """
            pass

        @abstractmethod
        def diffusion_coefficient(
            self, xt: torch.Tensor, t: torch.Tensor, **kwargs
        ) -> torch.Tensor:
            """
            Returns the diffusion coefficient of the ODE.
            Args:
                - xt: b ...
                - t: b
            Returns:
                - diffusion_coefficient: b ...
            """
            pass

    return ODE, SDE


@app.cell
def _(ABC, ODE, SDE, abstractmethod, torch, tqdm):
    class Simulator(ABC):
        @abstractmethod
        def step(
            self, xt: torch.Tensor, t: torch.Tensor, dt: torch.Tensor, **kwargs
        ):
            """
            Takes one simulation step
            Args:
                - xt: b ...
                - t: b
                - dt: b
            Returns:
                - nxt: b ...
            """
            pass

        @torch.no_grad()
        def simulate(
            self,
            x: torch.Tensor,
            ts: torch.Tensor,
            use_tqdm: bool = True,
            **kwargs,
        ):
            """
            Simulates using the discretization gives by ts
            Args:
                - x_init: b ...
                - ts: b
            Returns:
                - x_final: b ...
            """
            nts = ts.shape[1]
            pbar = tqdm(range(nts - 1)) if use_tqdm else range(nts - 1)
            for t_idx in pbar:
                t = ts[:, t_idx]
                h = ts[:, t_idx + 1] - ts[:, t_idx]
                x = self.step(x, t, h, **kwargs)
            return x

        @torch.no_grad()
        def simulate_with_trajectory(
            self,
            x: torch.Tensor,
            ts: torch.Tensor,
            use_tqdm: bool = True,
            **kwargs,
        ):
            """
            Simulates using the discretization gives by ts
            Args:
                - x: b ...
                - ts: b nt
            Returns:
                - x_traj: b nt ...
            """
            x_traj = [x.clone()]
            nts = ts.shape[1]
            pbar = tqdm(range(nts - 1)) if use_tqdm else range(nts - 1)
            for t_idx in pbar:
                t = ts[:, t_idx]
                h = ts[:, t_idx + 1] - ts[:, t_idx]
                x = self.step(x, t, h, **kwargs)
                x_traj.append(x.clone())
            return torch.stack(x_traj, dim=1)


    class EulerSimulator(Simulator):
        def __init__(self, ode: ODE):
            self.ode = ode

        def step(
            self, xt: torch.Tensor, t: torch.Tensor, h: torch.Tensor, **kwargs
        ):
            h = h.view([-1] + [1] * (len(xt.shape) - 1))
            return xt + self.ode.drift_coefficient(xt, t, **kwargs) * h


    class EulerMaruyamaSimulator(Simulator):
        def __init__(self, sde: SDE):
            self.sde = sde

        def step(
            self, xt: torch.Tensor, t: torch.Tensor, h: torch.Tensor, **kwargs
        ):
            h = h.view([-1] + [1] * (len(xt.shape) - 1))
            return (
                xt
                + self.sde.drift_coefficient(xt, t, **kwargs) * h
                + self.sde.diffusion_coefficient(xt, t, **kwargs)
                * torch.sqrt(h)
                * torch.randn_like(xt)
            )


    def record_every(num_timesteps: int, record_every: int) -> torch.Tensor:
        """
        Compute the indices to record in the trajectory given a record_every parameter
        """
        if record_every == 1:
            return torch.arange(num_timesteps)
        return torch.cat(
            [
                torch.arange(0, num_timesteps - 1, record_every),
                torch.tensor([num_timesteps - 1]),
            ]
        )

    return


