@app.cell
def _(
    ABC,
    List,
    Optional,
    Tuple,
    abstractmethod,
    nn,
    os,
    random,
    torch,
    tqdm,
    uuid,
):
    MiB = 1024**2


    def model_size_b(model: nn.Module) -> int:
        """
        Returns model size in bytes. Based on https://discuss.pytorch.org/t/finding-model-size/130275/2
        Args:
        - model: self-explanatory
        Returns:
        - size: model size in bytes
        """
        size = 0
        for param in model.parameters():
            size += param.nelement() * param.element_size()
        for buf in model.buffers():
            size += buf.nelement() * buf.element_size()
        return size


    class Trainer(ABC):
        def __init__(self, **kwargs):
            super().__init__()
            self.model = None
            self.opt = None
            self.output_dir = None

        @abstractmethod
        def get_train_loss(self, **kwargs) -> torch.Tensor:
            pass

        def checkpoint(self, step: int):
            pass

        def get_optimizer(self, lr: float):
            return torch.optim.AdamW(
                self.model.parameters(), lr=lr, weight_decay=1e-4
            )

        def random_name(self) -> str:
            adjectives = [
                "autumn",
                "hidden",
                "bitter",
                "misty",
                "silent",
                "empty",
                "dry",
                "dark",
                "summer",
                "icy",
                "delicate",
                "quiet",
                "white",
                "cool",
                "spring",
                "winter",
                "patient",
            ]
            foods = [
                "apple",
                "banana",
                "pear",
                "plum",
                "orange",
                "persimmon",
                "tangerine",
                "durian",
                "jackfruit",
                "jicama",
                "cantaloupe",
                "watermelon",
                "peach",
            ]
            return f"{random.choice(adjectives)}-{random.choice(foods)}-{str(uuid.uuid4())[:8]}"

        def train(
            self,
            model: nn.Module,
            num_steps: int,
            lr: float = 1e-3,
            warmup_steps: int = 500,
            ckpt_every: Optional[int] = 500,
            run_name: Optional[str] = None,
            **kwargs,
        ) -> Tuple[List[float], List[int]]:
            """
            Linear warmup from 0 -> lr over `warmup_steps`, then constant lr.
            """
            # Initialize run name and output directory
            run_name = run_name or self.random_name()
            self.output_dir = os.path.join("runs", run_name)
            os.makedirs(self.output_dir, exist_ok=False)
            print("Initialized output directory at: " + self.output_dir)

            # Grab size
            self.model = model
            size_b = model_size_b(self.model)
            print(f"Training model with size: {size_b / MiB:.3f} MiB")

            # Initialize optimizer and LR
            self.opt = self.get_optimizer(lr)
            self.model.train()

            for pg in self.opt.param_groups:
                pg["lr"] = 0.0

            # Main training loop
            losses: List[float] = []
            steps: List[int] = []

            pbar = tqdm(range(num_steps))
            for step in pbar:
                # Update LR
                if warmup_steps > 0 and step < warmup_steps:
                    cur_lr = lr * float(step + 1) / float(warmup_steps)
                else:
                    cur_lr = lr
                for pg in self.opt.param_groups:
                    pg["lr"] = cur_lr

                # Forward + backward
                self.opt.zero_grad(set_to_none=True)
                loss = self.get_train_loss(**kwargs)
                loss.backward()

                # Take gradient step
                self.opt.step()

                losses.append(float(loss.detach().item()))
                steps.append(step)

                pbar.set_description(
                    f"Step {step}, lr={cur_lr:.2e}, loss={loss.item():.4f}"
                )

                # Callback if specified
                if ckpt_every is not None and step % ckpt_every == 0:
                    self.model.eval()
                    self.checkpoint(step)
                    self.model.train()

            self.model.eval()
            return losses, list(range(num_steps))

    return (Trainer,)


