@app.cell
def _(LabeledSampleable, Tuple, datasets, nn, torch, transforms):
    class MNISTSampler(nn.Module, LabeledSampleable):
        """
        Sampleable wrapper for the MNIST dataset
        """

        def __init__(self):
            super().__init__()
            self.dataset = datasets.MNIST(
                root="./data",
                train=True,
                download=True,
                transform=transforms.Compose(
                    [
                        transforms.Resize((32, 32)),
                        transforms.ToTensor(),
                        transforms.Normalize((0.1305,), (0.2891,)),
                    ]
                ),
            )
            self.dummy = nn.Buffer(
                torch.zeros(1)
            )  # Will automatically be moved when self.to(...) is called...

        def sample(self, num_samples: int) -> Tuple[torch.Tensor, torch.Tensor]:
            """
            Args:
                - num_samples: the desired number of samples
            Returns:
                - samples: shape (batch_size, c, h, w)
                - labels: shape (batch_size, label_dim)
            """
            if num_samples > len(self.dataset):
                raise ValueError(
                    f"num_samples exceeds dataset size: {len(self.dataset)}"
                )

            indices = torch.randperm(len(self.dataset))[:num_samples]
            samples, labels = zip(*[self.dataset[i] for i in indices])
            samples = torch.stack(samples).to(self.dummy)
            labels = torch.tensor(labels, dtype=torch.int64).to(self.dummy.device)
            return samples, labels

    return (MNISTSampler,)


