@app.cell(hide_code=True)
def _(mo):
    mo.md(r"""
    # Part 2: Classifier Free Guidance


    **Guidance**: Whereas for unconditional generation, we simply wanted to generate *any* digit, we would now like to be able to specify, or *condition*, on the identity of the digit we would like to generate. That is, we would like to be able to say "generate an image of the digit 8", rather than just "generate an image of a digit". We will henceforth refer to the digit we would like to generate as $x \in \mathbb{R}^{1 \times 32 \times 32}$, and the conditioning variable (in this case, a label), as $y \in \{0, 1, \dots, 9\}$. If we imagine fixing our choice of $y$, and take our data distribution as $p_{\text{simple}}(x|y)$, then we have recovered the unconditional generative problem, and we can construct a generative model using e.g., a conditional flow matching objective via

    $$\begin{align*}\mathcal{L}_{\text{CFM}}^{\text{guided}}(\theta;y) &= \,\,\mathbb{E}_{\square} \lVert u_t^{\theta}(x|y) - u_t^{\text{ref}}(x|z)\rVert^2\\ \square &= z \sim p_{\text{data}}(z|y), x \sim p_t(x|z)\end{align*}$$

    We may now then allow $y$ to vary by simply taking our conditional flow matching expectation to be over $y$ as well (rather than fixing $y$), and explicitly conditioning our learned approximation on $u_t^{\theta}(x|y)$ on the choice of $y$. We therefore obtain the the *guided* conditional flow matching objective
    $$\begin{align*}\mathcal{L}_{\text{CFM}}(\theta) &= \,\,\mathbb{E}_{\square} \lVert u_t^{\theta}(x|y) - u_t^{\text{ref}}(x|z)\rVert^2\\ \square &= z,y \sim p_{\text{data}}(z,y), x \sim p_t(x|z)\end{align*}$$
    Note that $(z,y) \sim p_{\text{simple}}(z,y)$ is obtained in practice by sampling an image $z$, and a label $y$, from our labelled (MNIST) dataset. This is all well and good, and we emphasize that if our goal was simply to sample from $p_{\text{data}}(x|y)$, our job would be done (at least in theory). In practice, one might argue that we care more about the *perceptual quality* of our images. To this end, we will a derive a procedure known as *classifier-free guidance*.


    **Classifier-Free Guidance**: For the sake of intuition, we will develop guidance through the lense of Gaussian probability paths, although the final result might reasonably be applied to any probability path. Recall from the lecture that for $\displaystyle(a_t, b_t) = \left(\frac{\dot{\alpha}_t}{\alpha_t}, -\frac{\dot{\beta}_t \beta_t \alpha_t - \dot{\alpha}_t \beta_t^2}{\alpha_t}\right)$, we have
    $$u_t(x|y) = a_tx + b_t\nabla \log p_t(x|y).$$
    This identity allows us to relate the *conditional marginal velocity* $u_t(x|y)$ to the *conditional score* $\nabla \log p_t(x|y)$. However, notice that
    $$\nabla \log p_t(x|y) = \nabla \log \left(\frac{p_t(x)p_t(y|x)}{p_t(y)}\right) = \nabla \log p_t(x) + \nabla \log p_t(y|x),$$
    so that we may rewrite
    $$u_t(x|y) = a_tx + b_t(\nabla \log p_t(x) + \nabla \log p_t(y|x)) = u_t(x) + b_t \nabla \log p_t(y|x).$$
    An approximation of the term $\nabla \log p_t(y|x)$ could be considered as a sort of noisy classifier (and in fact this is the origin of *classifier guidance*, which we do not consider here). In practice, people have noticed that the conditioning seems to work better when we scale the contribution of this classifier term, yielding
    $$\tilde{u}_t(x|y) = u_t(x) + w b_t \nabla \log p_t(y|x)$$
    where $w > 1$ is known as the *guidance scale*. We may then plug in $b_t\log p_t(y|x) = u^{\text{target}}_t(x|y) - u^{\text{target}}_t(x)$ to obtain

    $$\begin{align}\tilde{u}_t(x|y) &= u_t(x) + w b_t \nabla \log p_t(y|x)\\&= u_t(x) + w (u^{\text{target}}_t(x|y) - u^{\text{target}}_t(x))\\&= (1-w) u_t(x) + w u_t(x|y). \end{align}$$

    The idea is thus to train both $u_t(x)$ as well as the conditional model $u_t(x|y)$, and then combine them *at inference time* to obtain $\tilde{u}_t(x|y)$. Our recipe will thus be:
    1. Train $u_t^{\theta} \approx u_t(x)$ as well as the conditional model $u_t^{\theta}(x|y) \approx u_t(x|y)$ using conditional flow matching.
    2. At inference time, sample using $\tilde{u}_t^{\theta}(x|y)$.

    "But wait!", you say, "why must we train two models?". Indeed, we can instead treat $u_t(x)$ as $u_t(x|y)$, where $y=\varnothing$ denotes *the absence of conditioning*. We may thus augment our label set with a new, additional $\varnothing$ label, so that $y \in \{0,1,\dots, 9, \varnothing\}$. This technique is known as **classifier-free guidance** (CFG). We thus arrive at
    $$\boxed{\tilde{u}_t(x|y) = (1-w) u_t(x|\varnothing) + w u_t(x|y)}.$$


    **Training and CFG**: We must now amend our conditional flow matching objective to account for the possibility of $y = \varnothing$. Of course, when we sample $(z,y)$ from MNIST, we will never obtain $y = \varnothing$, so we must introduce the possibliity of this artificially. To do so, we will define some hyperparameter $\eta$ to be the *probability* that we discard the original label $y$, and replace it with $\varnothing$. In practice, we might set $\varnothing = 10$, for example, as it is sufficient to distinguish it from the other digit identities. When we go and implement our model, we need ony be able to index into some embedding, such as via `torch.nn.Embedding`. We thus arrive at our CFG conditional flow matching training objective:
    $$\begin{align*}\mathcal{L}_{\text{CFM}}(\theta) &= \,\,\mathbb{E}_{\square} \lVert u_t^{\theta}(x|y) - u_t^{\text{ref}}(x|z)\rVert^2\\\square &= z,y \sim p_{\text{data}}(z,y), x \sim p_t(x|z),\,\text{replace $y$ with $\varnothing$ with probability $\eta$}\end{align*}$$
    In plain English, this objective reads:
    1. Sample an image $z$ and a label $y$ from $p_{\text{data}}$ (here, MNIST).
    2. With probability $\eta$, replace the label $y$ with the null label $\varnothing \triangleq 10$.
    3. Sample $t$ from $\mathcal{U}[0,1]$.
    4. Sample $x$ from the conditional probability path $p_t(x|z)$.
    5. Regress $u_t^{\theta}(x|y)$ against $u_t^{\text{ref}}(x|z)$.


    ### Question 2.2: Training for Classifier-Free Guidance
    In this section, you'll the training objective $\mathcal{L}_{\text{CFM}}(\theta)$ in which $u_t^{\theta}(x|y)$ is an instance of the class `ConditionalVectorField` described below.
    """)
    return


@app.cell
def _(ABC, ODE, abstractmethod, nn, torch):
    class ConditionalVectorField(nn.Module, ABC):
        """
        Conditional vector field u_t^theta(x|y)
        """

        @abstractmethod
        def forward(self, x: torch.Tensor, t: torch.Tensor, y: torch.Tensor):
            """
            Args:
            - x: b ...
            - t: b
            - y: b
            Returns:
            - u_t^theta(x|y): b ...
            """
            pass


    class CFGVectorFieldODE(ODE):
        def __init__(
            self,
            net: ConditionalVectorField,
            null_label: int,
            guidance_scale: float = 1.0,
        ):
            self.net = net
            self.guidance_scale = guidance_scale
            self.null_label = null_label

        def drift_coefficient(
            self, x: torch.Tensor, t: torch.Tensor, y: torch.Tensor
        ) -> torch.Tensor:
            """
            Args:
            - x: b ...
            - t: b
            - y: b
            """
            guided_vector_field = self.net(x, t, y)
            unguided_y = torch.ones_like(y) * self.null_label
            unguided_vector_field = self.net(x, t, unguided_y)
            return (
                1 - self.guidance_scale
            ) * unguided_vector_field + self.guidance_scale * guided_vector_field

    return (ConditionalVectorField,)


