@app.cell
def _(GaussianConditionalProbabilityPath, Trainer, nn, torch):
    class CFGTrainer(Trainer):
        def __init__(
            self,
            path: GaussianConditionalProbabilityPath,
            eta: float,
            null_label: int,
            eps: float = 0.001,
            **kwargs,
        ):
            assert eta > 0 and eta < 1
            super().__init__(**kwargs)
            self.eta = eta
            self.eps = eps
            self.path = path
            self.null_label = null_label

        def get_train_loss(self, batch_size: int) -> torch.Tensor:
            # Step 1: Sample z,y from p_data
            z,y = self.path.p_data.sample(batch_size)

            # Step 2: Set each label to 10 (i.e., null) with probability eta
            mask = torch.rand(batch_size) < self.eta
            y[mask] = self.null_label

            t = torch.rand(batch_size).to(z) * (1 - self.eps)
            x = self.path.sample_conditional_path(z, t)

            predictions = self.model(x, t, y)
            targets = self.path.conditional_vector_field(x, z, t)
            return nn.functional.mse_loss(predictions, targets)
        

    return (CFGTrainer,)


@app.cell
def _(ConditionalVectorField, List, Type, nn, torch):
    # Sanity check: implement MLPConditionalVectorField


    class MLP(nn.Module):
        def __init__(
            self,
            dims: List[int],
            activation: Type[torch.nn.Module] = torch.nn.SiLU,
        ):
            super().__init__()
            mlp = []
            for idx in range(len(dims) - 1):
                mlp.append(torch.nn.Linear(dims[idx], dims[idx + 1]))
                if idx < len(dims) - 2:
                    mlp.append(activation())
            self.net = torch.nn.Sequential(*mlp)

        def forward(self, x: torch.Tensor) -> torch.Tensor:
            """
            Args:
            - x: b n d
            Returns:
            - x: b n d
            """
            return self.net(x)


    class MLPConditionalVectorField(ConditionalVectorField):
        def __init__(
            self, dim: int, hidden_dim: int, class_dim: int, num_classes: int
        ):
            super().__init__()
            self.mlp = MLP([dim + class_dim + 1, hidden_dim, hidden_dim, dim])
            self.class_embedding = nn.Embedding(num_classes + 1, class_dim)

        def forward(self, x: torch.Tensor, t: torch.Tensor, y: torch.Tensor):
            """
            Args:
            - x: b d
            - t: b
            - y: b
            Returns:
            - u_t^theta(x|y): (b, c, h, w)
            """
            y_emb = self.class_embedding(y)
            inp = torch.cat(
                [
                    x, 
                    y_emb,
                    t.unsqueeze(-1)
                ],
                dim=-1,
            )
            return self.mlp(inp)
        

    return (MLPConditionalVectorField,)


